import io from "socket.io-client";

var socket;
class Header extends Component {
  constructor() {
    super();
    this.state = {
      endpoint: 'http://localhost:3001/'
    };
    socket = io(this.state.endpoint);
  }
render() {
    return (
        <div>Hello</div>
    );
  }
}
export default Header
